It’s Move of the Week time and this next four weeks of brought to you by JD and I! As a dancer we know we are stunning flexible and this is one way I was able to accomplish that!
.
@amber.perkins333 my cousin, dance teacher and choreographer, created this amazing class called Partnering that teaches dancers how to use their body and movement to communicate to their partner what they need. Her practice is being used all over the world and it’s one who has helped make me who I am! Grab a partner and let’s get FLEXIBLE!
.
.
